import React from 'react';

const sidefilter = props => (
    <div>
        <p> Annonces créées depuis </p>
        <input name="" type="radio" />
        <label>&nbsp; Un jour</label>
        <input name="" type="radio" />
        <label>&nbsp; Trois jour</label>
        <input name="" type="radio" />
        <label>&nbsp; Une semaine</label>
        <input name="" type="radio" />
        <label>&nbsp; Un jour</label>
    </div>
    
);

export default sidefilter;
